INSERT INTO `wx_news` VALUES ('9', '34', '儿童急性中耳炎的诊治与预防', '147753409019300000940967132582065352557_950.jpg', null, '中耳炎是一种常见的儿童疾病，孩子为什么容易患上急性中耳炎，一旦确诊患上急性中耳炎，我们又该怎么办？', , '1', '1477534094', null, 'admin', '0', null);
