INSERT INTO `wx_news` VALUES ('11', '34', '新生儿能晒太阳吗', '147756237414b8f932d393d40d9cc7ab2b388daaa7.jpeg', null, '刚出生的婴儿不可以直接置于太阳下，其娇嫩的皮肤容易受到阳光的伤害，两周后便可以让宝宝在室内接受斜照进来的温柔阳光', , '1', '1477562405', null, 'admin', '0', null);
