INSERT INTO `wx_news` VALUES ('30', '34', '宝宝干咳食疗法', '1477624825cb98e229c0ef6a21c63c5af4b071f9dc.jpg', null, '对于病情并不严重的宝宝来说，食疗法最为合适。比较推荐的有萝卜水、蜂蜜水、丝瓜饮等。', , '1', '1477624857', null, 'admin', '0', null);
INSERT INTO `wx_news` VALUES ('31', '34', '缓解宝宝干咳的推拿手法', '1477625139ac64ae2f4a3b687b1f768e434391c9db.jpg', null, '正确的推拿手法可以缓解宝宝的干咳。如果家长们要使用推拿法缓解宝宝的干咳症状，那么切忌随意摸索、胡摸乱弄。', , '1', '1477625155', null, 'admin', '0', null);
INSERT INTO `wx_news` VALUES ('32', '34', '幼儿长牙时间和顺序', '147762557433b943848110163078ae0ecd329f7b8b.jpg', null, '在6-7个月的时候，宝宝会长出人生中的第一颗牙齿，但实际上牙齿的萌出时间个体差异是很大的，所以有的宝宝牙齿萌出比较早，有的比较晚，但是只要在个体差异的范围内，宝宝长牙情况大部分都正常。', , '1', '1477625603', null, 'admin', '0', null);
INSERT INTO `wx_news` VALUES ('33', '34', '宝宝长牙的症状', '1477625848d519ae65a55aa785babd75373b4cbd7b.jpg', null, '长牙期间宝宝会有一些反常的表现，不同宝宝表现不同，主要有以下九个方面：', , '1', '1477625878', null, 'admin', '0', null);
INSERT INTO `wx_news` VALUES ('34', '34', '幼儿长牙时如何护理', '147762638058d97be487cfbd098775a9e80816238b.jpg', null, '按摩宝宝牙床，父母可以通过轻轻按摩宝宝红肿的牙肉来消除他的疼痛感。', , '1', '1477626415', '1477626902', 'admin', '1', null);
INSERT INTO `wx_news` VALUES ('35', '34', '幼儿长牙时如何护理', '147762638058d97be487cfbd098775a9e80816238b.jpg', null, '按摩宝宝牙床，父母可以通过轻轻按摩宝宝红肿的牙肉来消除他的疼痛感。', , '1', '1477626875', '1477626906', 'admin', '1', null);
