INSERT INTO `wx_news` VALUES ('37', '34', '幼儿厌食最容易得的疾病', '147762701456de86f0633eee6b2bca3656ef2d6ecd.jpg', null, '消化系统疾病，厌食最容易引起肠道疾病，且孩子由于缺少营养易得营养不良。', , '1', '1477627230', null, 'admin', '0', null);
INSERT INTO `wx_news` VALUES ('38', '34', '儿童冬季怎么穿衣？', '1477635198c71a3ad9f90881a3494141a2aa08b7bb.jpg', null, '冬天天气寒冷，温差很大，如果不注意保暖，很容易感冒。因此，对于宝宝而言，冬天最需要的是一件抗风的外套。家长可以给宝宝选择羽绒服或棉服，非常保暖舒适。 ', , '1', '1477635253', '1477644561', 'admin', '0', null);
